import React from "react";

const contactList = (props)=>{
    const renderContact=props.contacts.map((contact)=>{
        return(
            <div>
                <div>
                    <div>
                        {contact.name}
                    </div>
                </div>
            </div>
        );
    })
    return(
        <div>
            contact list
        </div>
    );
}

export default contactList
